import React from 'react';
import './App.css';
import pokemons from './data';
import Pokedex from './Pokedex';
import About from './About';
import { BrowserRouter, Route, Link, Switch } from 'react-router-dom';

function App() {
  return (
    <div className="App">
      <h1> Pokedex </h1>
      <About />
      <BrowserRouter>
        <Switch>
        <Link to='/'>Home</Link>
        <Link to='/about'>About</Link>
        <Link to='/favorites'>FavoritePokemons</Link>
        <Route path='/about' component={About} />
        <Route path='/'><Pokedex pokemons={pokemons} /></Route>
        </Switch>
      </BrowserRouter>
    </div>
  );
}

export default App;
